import React from "react";
import { Row, Col, Container } from "react-grid-system";
import "./scss/App.scss";

class Temp extends React.Component {
  render() {
    return (
      <Row align="center" justify="center">
        <Col xs={20}>
          <div className="temp">
            <img src={require("./images/dcoloaddesktop.gif")} />
          </div>
        </Col>
      </Row>
    );
  }
}

export default Temp;
